import React from "react";

import AD from "../../AD.jpg";

const about = () => {
  return (
    <div style={{ width: "100%", height: "90vh" }}>
      <div>
        <img
          src={AD}
          alt="ad"
          style={{
            width: "100px",
            position: "absolute",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        />
      </div>
    </div>
  );
};

export default about;
